(120, 4, 5, '<p>A, B and C jointly thought of engaging themselves in a business venture. It was agreed that A would invest Rs. 6500 for 6 months, B, Rs. 8400 for 5 months and C, Rs. 10,000 for 3 months. A wants to be the working member for which, he was to receive 5% of the profits. The profit earned was Rs. 7400. Calculate the share of B in the profit.</p>\n', '2'),
(121, 4, 5, '<p>A grocer has a sale of Rs. 6435, Rs. 6927, Rs. 6855, Rs. 7230 and Rs. 6562 for 5 consecutive months. How much sale must he have in the sixth month so that he gets an average sale of Rs. 6500?</p>\n', '1'),
(122, 4, 5, '<p>The ratio between the length and the breadth of a rectangular park is 3 : 2. If a man cycling along the boundary of the park at the speed of 12 km/hr completes one round in 8 minutes, then the area of the park (in sq. m) is:</p>\n', '2'),
(123, 4, 5, '<p>A hall is 15 m long and 12 m broad. If the sum of the areas of the floor and the ceiling is equal to the sum of the areas of four walls, the volume of the hall is:</p>\n', '3'),
(124, 4, 5, '<p>A hollow iron pipe is 21 cm long and its external diameter is 8 cm. If the thickness of the pipe is 1 cm and iron weighs 8 g/cm3, then the weight of the pipe is:</p>\n', '2'),
(125, 4, 5, '<p>From a group of 7 men and 6 women, five persons are to be selected to form a committee so that at least 3 men are there on the committee. In how many ways can it be done?</p>\n', '3'),
(126, 4, 5, '<p>A number when divided successively by 4 and 5 leaves remainders 1 and 4 respectively. When it is successively divided by 5 and 4, then the respective remainders will be</p>\n', '2'),
(127, 4, 5, '<p>Out of 7 consonants and 4 vowels, how many words of 3 consonants and 2 vowels can be formed?</p>\n', '3'),
(128, 4, 5, '<p>The difference between a two-digit number and the number obtained by interchanging the positions of its digits is 36. What is the difference between the two digits of that number?</p>\n', '2'),
(129, 4, 5, '<p>Six bells commence tolling together and toll at intervals of 2, 4, 6, 8 10 and 12 seconds respectively. In 30 minutes, how many times do they toll together ?</p>\n', '4'),
(130, 4, 5, '<p>If 2994 ÷ 14.5 = 172, then 29.94 ÷ 1.45 = ?</p>\n', '3'),
(131, 4, 5, '<p>There are two examinations rooms A and B. If 10 students are sent from A to B, then the number of students in each room is the same. If 20 candidates are sent from B to A, then the number of students in A is double the number of students in B. The number of students in room A is:</p>\n', '3'),
(132, 4, 5, '<p>There are two examinations rooms A and B. If 10 students are sent from A to B, then the number of students in each room is the same. If 20 candidates are sent from B to A, then the number of students in A is double the number of students in B. The number of students in room A is:</p>\n', '3'),
(133, 4, 5, '<p>A tank is filled by three pipes with uniform flow. The first two pipes operating simultaneously fill the tank in the same time during which the tank is filled by the third pipe alone. The second pipe fills the tank 5 hours faster than the first pipe and 4 hours slower than the third pipe. The time required by the first pipe is:</p>\n', '3'),
(134, 4, 5, '<p>Running at the same constant rate, 6 identical machines can produce a total of 270 bottles per minute. At this rate, how many bottles could 10 such machines produce in 4 minutes?</p>\n', '2'),
(135, 4, 5, '<p>A can contains a mixture of two liquids A and B is the ratio 7 : 5. When 9 litres of mixture are drawn off and the can is filled with B, the ratio of A and B becomes 7 : 9. How many litres of liquid A was contained by the can initially?</p>\n', '3'),
(136, 4, 5, '<p>If Rs. 10 be allowed as true discount on a bill of Rs. 110 due at the end of a certain time, then the discount allowed on the same sum due at the end of double the time is:</p>\n', '4'),
(137, 4, 5, '<p> <strong>Directions to Solve</strong> :   In each of the following questions, arrange the given words in a meaningful sequence and thus find the correct answer from alternatives.</p>\n\n<p><strong>Q. Arrange the words given below in a meaningful sequence.</strong></p>\n\n<ol>\n	<li><strong>Key</strong></li>\n	<li><strong>Door</strong></li>\n	<li><strong>Lock</strong></li>\n	<li><strong> Room</strong></li>\n	<li><strong> Switch on </strong></li>\n</ol>\n', '3'),
(138, 4, 5, '<p><strong>Directions to Solve</strong> : - In each of the following questions, arrange the given words in a meaningful sequence and thus find the correct answer from alternatives.</p>\n\n<p><strong>   Q. Arrange the words given below in a meaningful sequence.</strong></p>\n\n<ol>\n	<li><strong>Word </strong></li>\n	<li><strong>Paragraph </strong></li>\n	<li><strong>Sentence </strong></li>\n	<li><strong>Letters </strong></li>\n	<li><strong>Phrase</strong></li>\n</ol>\n', '4'),
(139, 4, 5, '<p><strong>Directions to Solve</strong> : Read each sentence to find out whether there is any grammatical error in it. The error, if any will be in one part of the sentence. The letter of that part is the answer. If there is no error, the answer is \'D\'. (Ignore the errors of punctuation, if any).</p>\n\n<p><strong>   Q. </strong>(solve as per the <strong>direction</strong> given above)</p>\n\n<p> </p>\n', '1'),
(140, 4, 5, '<p><strong> Directions to Solve</strong> : In the following the questions choose the word which best expresses the meaning of the given word.</p>\n\n<p><strong>     Q. CORPULENT</strong></p>\n', '4'),
(141, 4, 5, '<p><strong>Directions to Solve</strong> : In the following the questions choose the word which best expresses the meaning of the given word.</p>\n\n<p><strong>     Q.AUGUST</strong></p>\n', '3'),
(142, 4, 5, '<p><strong>Directions to Solve</strong> : In the following questions choose the word which is the exact OPPOSITE of the given words.</p>\n\n<p><strong>    Q. ENORMOUS </strong></p>\n', '3'),
(143, 4, 5, '<p><strong>Directions to Solve</strong> : In the following questions choose the word which is the exact OPPOSITE of the given words.</p>\n\n<p><strong>   Q. ARTIFICIAL</strong></p>\n', '2'),
(144, 4, 5, '<p><strong>Directions to Solve</strong> : In each question below a sentence broken into five or six parts. Join these parts to make a meaningful sentence. The correct order of parts is the answer.</p>\n\n<ol>\n	<li><strong>I</strong></li>\n	<li><strong>immediately</strong></li>\n	<li><strong>salary</strong></li>\n	<li><strong>my</strong></li>\n	<li><strong>want</strong></li>\n</ol>\n', '2'),
(145, 4, 5, '<p><strong> Directions to Solve</strong> : In each question below, there is a sentence of which some parts have been jumbled up. Rearrange these parts which are labelled P, Q, R and S to produce the correct sentence. Choose the proper sequence.</p>\n\n<p><strong>When he</strong></p>\n\n<p><strong>P :    did not know</strong></p>\n\n<p><strong>Q :    he was nervous and</strong></p>\n\n<p><strong>R :    heard the hue and cry at midnight</strong></p>\n\n<p><strong>S :    what to do</strong></p>\n\n<p><strong>The Proper sequence should be:</strong></p>\n', '1'),
(146, 4, 5, '<p> <strong>Directions to Solve</strong> : In each question below, there is a sentence of which some parts have been jumbled up. Rearrange these parts which are labelled P, Q, R and S to produce the correct sentence. Choose the proper sequence.</p>\n\n<p><strong>   It has been established that</strong></p>\n\n<p><strong>       P :    Einstein was</strong></p>\n\n<p><strong>       Q :    although a great scientist</strong></p>\n\n<p><strong>       R :    weak in arithmetic</strong></p>\n\n<p><strong>      S :    right from his school days</strong></p>\n\n<p><strong>  The Proper sequence should be:</strong></p>\n', '2'),
(147, 4, 5, '<p><strong> Directions to Solve</strong>: In each question below, there is a sentence of which some parts have been jumbled up. Rearrange these parts which are labelled P, Q, R and S to produce the correct sentence. Choose the proper sequence.</p>\n\n<p><strong>    Then</strong></p>\n\n<p><strong>        P :    it struck me</strong></p>\n\n<p><strong>       Q :    of course</strong></p>\n\n<p><strong>       R :    suitable it was</strong></p>\n\n<p><strong>       S :    how eminently</strong></p>\n\n<p><strong>   The Proper sequence should be:</strong></p>\n', '3'),
(148, 4, 5, '<p><strong>Directions to Solve</strong>: Each question consist of two words which have a certain relationship to each other followed by four pairs of related words, Select the pair which has the same relationship.</p>\n\n<p><strong>    Q. PAIN:SEDATIVE</strong></p>\n', '2'),
(149, 4, 5, '<p><strong>Directions to Solve</strong>: Each question consist of two words which have a certain relationship to each other followed by four pairs of related words, Select the pair which has the same relationship.</p>\n\n<p><strong>    Q. LIGHT:BLIND</strong></p>\n', '1'),
(150, 4, 5, '<p><strong> Directions to Solve</strong> : Each question consist of two words which have a certain relationship to each other followed by four pairs of related words, Select the pair which has the same relationship.</p>\n\n<p> <strong>    Q. SYMPHONY:COMPOSER</strong></p>\n', '2'),
(151, 4, 5, '<p><strong> Directions to Solve</strong> : In the questions below the sentences have been given in Direct/Indirect speech. From the given alternatives, choose the one which best expresses the given sentence in Indirect/Direct speech.</p>\n\n<p>  <strong> Q. \"If you don\'t keep quiet I shall shoot you\", he said to her in a calm voice.</strong></p>\n', '3'),
(152, 4, 5, '<p><strong> Directions to Solve:</strong>In the questions below the sentences have been given in Active/Passive voice. From the given alternatives, choose the one which best expresses the given sentence in Passive/Active voice.</p>\n\n<p><strong>    Q. After driving professor Kumar to the museum she dropped him at his hotel.</strong></p>\n', '1'),
(153, 4, 5, '<p><strong>Directions to Solve</strong> : Some proverbs/idioms are given below together with their meanings. Choose the correct meaning of proverb/idiom, If there is no correct meaning given, E (i.e.) \'None of these\' will be the answer.</p>\n\n<p>   <strong> Q.To make clean breast of</strong></p>\n', '3'),
(154, 4, 5, '<p><strong> Directions to Solve:</strong> In questions given below out of four alternatives, choose the one which can be substituted for the given word/sentence.</p>\n\n<p><strong>     Q. Extreme old age when a man behaves like a fool</strong></p>\n', '3'),
(155, 4, 5, '<p><strong>Directions to Solve</strong>: In questions given below out of four alternatives, choose the one which can be substituted for the given word/sentence.</p>\n\n<p><strong>   Q. That which cannot be corrected</strong></p>\n', '4'),
(156, 4, 5, '<p>Today most businessmen are very worried. To begin with, they are not used to competition.In the past they sold whatever ...(1)... produced at whatever prices they chose. </p>\n', '3'),
(157, 4, 5, '<p>Rearrange the following five sentences in proper sequence so as to for a meaningful paragraph, then answer the questions given below them.After Examining him, the doctor smiled at him mischievously and took out a syringe.Thinking that he was really sick, his father summoned the family doctor.That day, Mintu wanted to take a day off from schoolImmediately, Mintu jumped up from his bed and swore the he was fineTherefor; he pretended to be sick and remained in bed.</p>\n\n<p><strong>Q. Which sentence should come <ins>third</ins></strong><em>  </em><strong>in the paragraph?</strong></p>\n', '2'),
(158, 4, 5, '<p><strong> Directions to Solve</strong> : In each question, an incomplete statement (Stem) followed by fillers is given. Pick out the best one which can complete incomplete stem correctly and meaningfully.</p>\n\n<p><strong>     Q.Despite his best efforts to conceal his anger ......</strong></p>\n', '4'),
(159, 4, 5, '<p><strong>Directions to Solve</strong> : In questions given below, a part of the sentence is <em>italicised and underlined</em>. Below are given alternatives to the italicised part which may improve the sentence. </p>\n\n<p>   <strong>Q.The workers are <em>hell bent at getting</em> what is due to them.</strong></p>\n', '3'),
(160, 4, 5, '<p><strong>Directions to Solve</strong> : In questions given below, a part of the sentence is <em>italicised and underlined</em>. Below are given alternatives to the italicised part which may improve the sentence. </p>\n\n<p><strong>     Q. When it was feared that the serfs might go too far and gain their freedom from serfdom, the protestant leaders joined the princes <em>at crushing</em> them.</strong></p>\n', '2'),
(161, 4, 5, '<p><strong>Directions to Solve</strong> : In questions given below, a part of the sentence is <em>italicised and underlined</em>. Below are given alternatives to the italicised part which may improve the sentence. </p>\n\n<p><strong>     Q.<em>If the room had been brighter</em>, I would have been able to read for a while before bed time.</strong></p>\n\n<p> </p>\n', '3'),
