(169, 4, 5, '<p><strong>Directions to Solve:</strong>Three of the words will be in the same classification, the remaining one will not be. Your answer will be the one word that does NOT belong in the same classification as the others.</p>\n\n<p><strong>    Q. Which word does NOT belong with the others?</strong></p>\n', '4'),
(170, 4, 5, '<p><strong> Directions to Solve : </strong>Each question has an underlined word followed by four answer choices. You will choose the word that is a necessary part of the underlined word.</p>\n\n<p><strong>   Q.<ins>harvest</ins></strong></p>\n', '4'),
(171, 4, 5, '<p>If A + B means A is the brother of B; A - B means A is the sister of B and A x B means A is the father of B. Which of the following means that C is the son of M?</p>\n', '4'),
