(173, 4, 5, '<p> </p>\n\n<p> Which symbol will be on the face opposite to the face with symbol * ?<img src=\"https://www.indiabix.com/_files/images/verbal-reasoning/dice/4-13-1-4.png\" /></p>\n', '3'),
