(233, 6, 7, '<p>Six bells commence tolling together and toll at intervals of 2, 4, 6, 8 10 and 12 seconds respectively. In 30 minutes, how many times do they toll together ?</p>\n', '4'),
(234, 6, 7, '<p>If 2994 ÷ 14.5 = 172, then 29.94 ÷ 1.45 = ?</p>\n', '3'),
(235, 6, 7, '<p>Running at the same constant rate, 6 identical machines can produce a total of 270 bottles per minute. At this rate, how many bottles could 10 such machines produce in 4 minutes?</p>\n', '2'),
(236, 6, 7, '<p>A can contains a mixture of two liquids A and B is the ratio 7 : 5. When 9 litres of mixture are drawn off and the can is filled with B, the ratio of A and B becomes 7 : 9. How many litres of liquid A was contained by the can initially?</p>\n', '3'),
(237, 6, 7, '<p><strong>Directions to Solve</strong> : In questions given below, a part of the sentence is <em>italicised and underlined</em>. Below are given alternatives to the italicised part which may improve the sentence. </p>\n\n<p><strong>     Q.<em>If the room had been brighter</em>, I would have been able to read for a while before bed time.</strong></p>\n', '2'),
(238, 6, 7, '<p><strong>Directions to Solve</strong> : In questions given below, a part of the sentence is <em>italicised and underlined</em>. Below are given alternatives to the italicised part which may improve the sentence. </p>\n\n<p><strong>     Q. When it was feared that the serfs might go too far and gain their freedom from serfdom, the protestant leaders joined the princes <em>at crushing</em> them.</strong></p>\n', '3'),
(239, 6, 7, '<p><strong>Directions to Solve</strong> : In questions given below, a part of the sentence is <em>italicised and underlined</em>. Below are given alternatives to the italicised part which may improve the sentence. </p>\n\n<p>   <strong>Q.The workers are <em>hell bent at getting</em> what is due to them.</strong></p>\n', '1'),
(240, 6, 7, '<p><strong> Directions to Solve</strong> : In each question, an incomplete statement (Stem) followed by fillers is given. Pick out the best one which can complete incomplete stem correctly and meaningfully.</p>\n\n<p><strong>     Q.Despite his best efforts to conceal his anger ......</strong></p>\n', '2'),
(241, 6, 7, '<p>Rearrange the following five sentences in proper sequence so as to for a meaningful paragraph, then answer the questions given below them.After Examining him, the doctor smiled at him mischievously and took out a syringe.Thinking that he was really sick, his father summoned the family doctor.That day, Mintu wanted to take a day off from schoolImmediately, Mintu jumped up from his bed and swore the he was fineTherefor; he pretended to be sick and remained in bed.</p>\n\n<p><strong>Q. Which sentence should come <ins>third</ins></strong><em>  </em><strong>in the paragraph?</strong></p>\n', '2'),
(242, 6, 7, '<p>Today most businessmen are very worried. To begin with, they are not used to competition.In the past they sold whatever ...(1)... produced at whatever prices they chose. </p>\n', '3'),
(243, 6, 7, '<p><strong>Directions to Solve</strong>: In questions given below out of four alternatives, choose the one which can be substituted for the given word/sentence.</p>\n\n<p><strong>   Q. That which cannot be corrected</strong></p>\n', '1'),
(244, 6, 7, '<p><strong> Directions to Solve:</strong> In questions given below out of four alternatives, choose the one which can be substituted for the given word/sentence.</p>\n\n<p><strong>     Q. Extreme old age when a man behaves like a fool</strong></p>\n', '3'),
(245, 6, 7, '<p><strong>Directions to Solve</strong> : Some proverbs/idioms are given below together with their meanings. Choose the correct meaning of proverb/idiom, If there is no correct meaning given, E (i.e.) \'None of these\' will be the answer.</p>\n\n<p>   <strong> Q.To make clean breast of</strong></p>\n', '3'),
(246, 6, 7, '<p><strong>Directions to Solve:</strong>In the questions below the sentences have been given in Active/Passive voice. From the given alternatives, choose the one which best expresses the given sentence in Passive/Active voice.</p>\n\n<p><strong>    Q. After driving professor Kumar to the museum she dropped him at his hotel</strong></p>\n', '1'),
(247, 6, 7, '<p><strong>Directions to Solve</strong> : In the questions below the sentences have been given in Direct/Indirect speech. From the given alternatives, choose the one which best expresses the given sentence in Indirect/Direct speech.</p>\n\n<p>  <strong> Q. \"If you don\'t keep quiet I shall shoot you\", he said to her in a calm voice</strong></p>\n', '2'),
(248, 6, 7, '<p><strong>Directions to Solve</strong> : Each question consist of two words which have a certain relationship to each other followed by four pairs of related words, Select the pair which has the same relationship.</p>\n\n<p> <strong>    Q. SYMPHONY:COMPOSE</strong></p>\n', '2'),
(249, 6, 7, '<p><strong>Directions to Solve</strong>: Each question consist of two words which have a certain relationship to each other followed by four pairs of related words, Select the pair which has the same relationship.</p>\n\n<p><strong>    Q. PAIN:SEDATIVE</strong></p>\n', '2'),
(250, 6, 7, '<p><strong>Directions to Solve</strong>: In each question below, there is a sentence of which some parts have been jumbled up. Rearrange these parts which are labelled P, Q, R and S to produce the correct sentence. Choose the proper sequence.</p>\n\n<p><strong>    Then</strong></p>\n\n<p><strong>        P :    it struck me</strong></p>\n\n<p><strong>       Q :    of course</strong></p>\n\n<p><strong>       R :    suitable it was</strong></p>\n\n<p><strong>       S :    how eminently</strong></p>\n\n<p><strong>   The Proper sequence should be:</strong></p>\n', '3'),
(251, 6, 7, '<p><strong>Directions to Solve</strong> : In each question below, there is a sentence of which some parts have been jumbled up. Rearrange these parts which are labelled P, Q, R and S to produce the correct sentence. Choose the proper sequence.</p>\n\n<p><strong>   It has been established that</strong></p>\n\n<p><strong>       P :    Einstein was</strong></p>\n\n<p><strong>       Q :    although a great scientist</strong></p>\n\n<p><strong>       R :    weak in arithmetic</strong></p>\n\n<p><strong>      S :    right from his school days</strong></p>\n\n<p><strong>  The Proper sequence should be:</strong></p>\n', '2'),
(252, 6, 7, '<p><strong>Directions to Solve</strong> : In each question below a sentence broken into five or six parts. Join these parts to make a meaningful sentence. The correct order of parts is the answer.</p>\n\n<ol>\n	<li><strong>I</strong></li>\n	<li><strong>immediately</strong></li>\n	<li><strong>salary</strong></li>\n	<li><strong>my</strong></li>\n	<li><strong>want</strong></li>\n</ol>\n', '3'),
(253, 6, 7, '<p><strong>Directions to Solve</strong> : In the following questions choose the word which is the exact OPPOSITE of the given words.</p>\n\n<p><strong>    Q. ENORMOUS </strong></p>\n', '3'),
(254, 6, 7, '<p><strong>Directions to Solve</strong> : - In each of the following questions, arrange the given words in a meaningful sequence and thus find the correct answer from alternatives.</p>\n\n<p><strong>   Q. Arrange the words given below in a meaningful sequence.</strong></p>\n\n<ol>\n	<li><strong>Word </strong></li>\n	<li><strong>Paragraph </strong></li>\n	<li><strong>Sentence </strong></li>\n	<li><strong>Letters </strong></li>\n	<li><strong>Phrase</strong></li>\n</ol>\n', '4');
