(255, 6, 7, '<p><strong>Directions to Solve</strong> : Read each sentence to find out whether there is any grammatical error in it. The error, if any will be in one part of the sentence. The letter of that part is the answer. If there is no error, the answer is \'D\'. (Ignore the errors of punctuation, if any).</p>\n\n<p><strong>   Q. </strong>(solve as per the <strong>direction</strong> given above)</p>\n', '2'),
