(1057, 16, 16, '<p><strong>Directions to Solve</strong> : In each question below, there is a sentence of which some parts have been jumbled up. Rearrange these parts which are labelled P, Q, R and S to produce the correct sentence. Choose the proper sequence.</p>\n\n<p><strong>Since the beginning of history</strong></p>\n\n<p><strong>   P :    have managed to catch</strong></p>\n\n<p><strong>   Q :    the Eskimos and Red Indians</strong></p>\n\n<p><strong>   R :    by a very difficulty method</strong></p>\n\n<p><strong>  S :    a few specimens of this aquatic animal</strong></p>\n\n<p><strong>The Proper sequence should be:</strong></p>\n', '4'),
